// Compiler result to JSON file
import { createComponent } from 'js/declViewModelService';
import { registerDynImportEntry } from 'js/moduleLoader';
import AwParseService from 'js/awParseService';
import AwFilterService from 'js/awFilterService';
import { getField } from 'js/utils';
import { Fragment } from 'react';
let filterSer = AwFilterService.instance;



/*
render function
*/
import { commonGlobalNavigationBarRenderFunction } from 'js/CommonGlobalNavigationBarService';


/*
ctx imports
*/

const ctxImportObj = {  };


/*
dynamic import
 */
registerDynImportEntry('js/CommonGlobalNavigationBarService', () => import('js/CommonGlobalNavigationBarService'));;

/*
view model
 */
const declViewModelJson = {
    "schemaVersion": "1.0.0",
    "data": {},
    "actions": {
        "render": {
            "method": "commonGlobalNavigationBarRenderFunction",
            "deps": "js/CommonGlobalNavigationBarService"
        }
    },
    "lifecycleHooks": {
        "render": "render"
    },
    "_viewModelId": "CommonGlobalNavigationBar",
    "_uniqueViewModelId": "CommonGlobalNavigationBar",
    "ctx": {}
};




/*
define component
*/
const Component = createComponent( declViewModelJson, commonGlobalNavigationBarRenderFunction, undefined, ctxImportObj );

export default Component;
